    console.log (callback(ele)); // check the boolean result of callback function

    if (callback(ele) === true) { // filters out any that does not meet condition
      newArray.push(ele);
    }

    console.log(newArray); // check what is pushed into the array
  }


  // Add your code above this line
  return newArray;

};

